<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <title>iPhone Home</title>
    
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            -webkit-tap-highlight-color: transparent;
        }

        html, body {
            height: 100%;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, "SF Pro Display", sans-serif;
            overflow: hidden;
            width: 100vw;
            height: 100vh;
            position: fixed;
            background: linear-gradient(135deg, 
                #FFB6C1 0%,
                #FFB6D9 15%,
                #E6C9E6 30%,
                #C8B5E6 45%,
                #9B8FC7 60%,
                #7B68B8 75%,
                #5B4FA3 90%,
                #3E3674 100%
            );
            user-select: none;
        }

        body::before {
            content: '';
            position: absolute;
            inset: 0;
            background: 
                radial-gradient(ellipse at 70% 20%, rgba(200, 181, 230, 0.3), transparent 50%),
                radial-gradient(ellipse at 30% 80%, rgba(91, 79, 163, 0.3), transparent 50%);
            pointer-events: none;
        }

        .home-screen {
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            padding: 20px 20px 34px 20px;
            position: relative;
            z-index: 1;
        }

        .app-grid {
            flex: 1;
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            grid-template-rows: repeat(5, 1fr);
            gap: 18px 14px;
            padding: 0;
            align-content: start;
        }

        .app-icon {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 6px;
            cursor: pointer;
            transition: transform 0.15s ease;
        }

        .app-icon:active {
            transform: scale(0.92);
        }

        .icon-wrapper {
            width: 60px;
            height: 60px;
            border-radius: 13px;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.15);
            display: flex;
            align-items: center;
            justify-content: center;
            overflow: hidden;
            transition: all 0.4s ease;
            background: white;
        }

        .app-icon.moving .icon-wrapper {
            transform: translateY(-5px);
            box-shadow: 0 8px 20px rgba(0, 0, 0, 0.25);
        }

        .icon-image {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .letter-icon {
            width: 100%;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            color: white;
            font-size: 32px;
            font-weight: 700;
        }

        .app-name {
            color: white;
            font-size: 11px;
            font-weight: 500;
            text-align: center;
            text-shadow: 0 1px 3px rgba(0, 0, 0, 0.5);
            max-width: 62px;
            line-height: 1.1;
        }

        .dock {
            background: rgba(255, 255, 255, 0.25);
            backdrop-filter: blur(30px);
            border-radius: 16px;
            padding: 8px 16px;
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 20px;
            margin-top: auto;
            box-shadow: 0 4px 16px rgba(0, 0, 0, 0.15);
            cursor: pointer;
            transition: all 0.2s ease;
            z-index: 2000;
            position: relative;
        }

        .dock:active {
            transform: scale(0.98);
            background: rgba(255, 255, 255, 0.3);
        }

        .page-dots {
            display: flex;
            justify-content: center;
            gap: 8px;
            padding: 12px 0;
        }

        .dot {
            width: 6px;
            height: 6px;
            border-radius: 50%;
            background: rgba(255, 255, 255, 0.6);
        }

        .dot.active {
            background: white;
            width: 22px;
            border-radius: 3px;
        }

        .secret-controls {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 150px;
            display: grid;
            grid-template-columns: 1fr 1fr;
            pointer-events: none;
            z-index: 100;
        }

        .secret-btn {
            pointer-events: auto;
            background: transparent;
            border: none;
            cursor: pointer;
        }

        .secret-btn:active {
            background: rgba(255, 255, 255, 0.15);
        }

        .pulse-indicator {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            background: rgba(0, 0, 0, 0.85);
            color: white;
            padding: 20px 40px;
            border-radius: 16px;
            font-size: 48px;
            font-weight: 700;
            opacity: 0;
            pointer-events: none;
            transition: opacity 0.3s;
            z-index: 3000;
        }

        .pulse-indicator.show {
            opacity: 1;
        }
    </style>
</head>
<body>
    <div class="home-screen">
        <div class="secret-controls">
            <button class="secret-btn left" id="leftBtn"></button>
            <button class="secret-btn right" id="rightBtn"></button>
        </div>

        <div class="pulse-indicator" id="pulseIndicator">0</div>

        <div class="app-grid" id="appGrid"></div>

        <div class="page-dots">
            <div class="dot active"></div>
            <div class="dot"></div>
        </div>

        <div class="dock" id="dock"></div>
    </div>

            '5-2': 'CINCODEDIAMANTES',
            '5-3': 'CINCODETREBOLES',
            '5-4': 'CINCODEPICAS',
            '6-1': 'SEISDECORAZONES',
            '6-2': 'SEISDEDIAMANTES',
            '6-3': 'SEISDETREBOLES',
            '6-4': 'SEISDEPICAS',
            '7-1': 'SIETEDECORAZONES',
            '7-2': 'SIETEDEDIAMANTES',
            '7-3': 'SIETEDETREBOLES',
            '7-4': 'SIETEDEPICAS',
            '8-1': 'OCHODECORAZONES',
            '8-2': 'OCHODEDIAMANTES',
            '8-3': 'OCHODETREBOLES',
            '8-4': 'OCHODEPICAS',
            '9-1': 'NUEVEDECORAZONES',
            '9-2': 'NUEVEDEDIAMANTES',
            '9-3': 'NUEVEDETREBOLES',
            '9-4': 'NUEVEDEPICAS',
            '10-1': 'DIEZDECORAZONES',
            '10-2': 'DIEZDEDIAMANTES',
            '10-3': 'DIEZDETREBOLES',
            '10-4': 'DIEZDEPICAS',
            '11-1': 'JOTADECORAZONES',
            '11-2': 'JOTADEDIAMANTES',
            '11-3': 'JOTADETREBOLES',
            '11-4': 'JOTADEPICAS',
            '12-1': 'REINADECORAZONES',
            '12-2': 'REINADEDIAMANTES',
            '12-3': 'REINADETREBOLES',
            '12-4': 'REINADEPICAS',
            '13-1': 'REYDECORAZONES',
            '13-2': 'REYDEDIAMANTES',
            '13-3': 'REYDETREBOLES',
            '13-4': 'REYDEPICAS',
        };

        let pulseCount = 0;
        let mode = 'value';
        let cardValue = null;
        let cardSuit = null;
        let pulseTimeout = null;
        let isRevealed = false;
        let currentApps = [];

        function shuffleArray(array) {
            const arr = [...array];
            for (let i = arr.length - 1; i > 0; i--) {
                const j = Math.floor(Math.random() * (i + 1));
                [arr[i], arr[j]] = [arr[j], arr[i]];
            }
            return arr;
        }

        function createAppIcon(app, isDock = false) {
            const icon = document.createElement('div');
            icon.className = 'app-icon';
            if (app.letter) {
                icon.dataset.letter = app.letter;
            }
            icon.dataset.name = app.name;

            const iconWrapper = document.createElement('div');
            iconWrapper.className = 'icon-wrapper';

            if (app.icon && ICONS[app.icon]) {
                const img = document.createElement('img');
                img.className = 'icon-image';
                img.src = ICONS[app.icon];
                img.alt = app.name;
                iconWrapper.appendChild(img);
            } else if (app.color) {
                iconWrapper.style.background = app.color;
                const letter = document.createElement('div');
                letter.className = 'letter-icon';
                letter.textContent = app.letter;
                iconWrapper.appendChild(letter);
            }
            
            if (!isDock) {
                const name = document.createElement('div');
                name.className = 'app-name';
                name.textContent = app.name;
                icon.appendChild(iconWrapper);
                icon.appendChild(name);
            } else {
                icon.appendChild(iconWrapper);
            }

            return icon;
        }

        function getAppsForCard(cardText) {
            const letters = cardText.split('');
            const neededApps = [];
            const usedIndices = new Set();

            letters.forEach(letter => {
                const appIndex = allApps.findIndex((app, index) => 
                    app.letter === letter && !usedIndices.has(index)
                );
                
                if (appIndex !== -1) {
                    neededApps.push(allApps[appIndex]);
                    usedIndices.add(appIndex);
                }
            });

            const availableApps = allApps.filter((app, index) => !usedIndices.has(index));
            const shuffled = shuffleArray(availableApps);
            
            while (neededApps.length < 20 && shuffled.length > 0) {
                neededApps.push(shuffled.shift());
            }

            return neededApps.slice(0, 20);
        }

        function getInitialApps() {
            return shuffleArray([...allApps]).slice(0, 20);
        }

        function renderApps(apps = null) {
            const appGrid = document.getElementById('appGrid');
            const dock = document.getElementById('dock');

            appGrid.innerHTML = '';
            dock.innerHTML = '';

            const toRender = apps || currentApps;
            
            toRender.forEach(app => {
                appGrid.appendChild(createAppIcon(app));
            });

            dockApps.forEach(app => {
                dock.appendChild(createAppIcon(app, true));
            });
        }

        function showPulse(count) {
            const indicator = document.getElementById('pulseIndicator');
            indicator.textContent = count;
            indicator.classList.add('show');
            setTimeout(() => {
                indicator.classList.remove('show');
            }, 500);
        }

        function handlePulse(side) {
            if (isRevealed) return;
            
            const correctSide = mode === 'value' ? 'left' : 'right';
            if (side !== correctSide) return;

            pulseCount++;
            showPulse(pulseCount);

            clearTimeout(pulseTimeout);
            
            pulseTimeout = setTimeout(() => {
                confirmValue();
            }, 2000);
        }

        function confirmValue() {
            if (mode === 'value') {
                cardValue = pulseCount;
                console.log(` Valor: ${cardValue}`);
                mode = 'suit';
                pulseCount = 0;
            } else {
                cardSuit = pulseCount;
                console.log(` Palo: ${cardSuit}`);
                setTimeout(() => {
                    performMagicReveal(cardValue, cardSuit);
                }, 1000);
            }
        }

        function performMagicReveal(value, suit) {
            const cardKey = `${value}-${suit}`;
            const cardText = cardMappings[cardKey];

            if (!cardText) {
                console.error(` Carta no existe`);
                resetTrick();
                return;
            }

            console.log(` ${cardText}`);
            isRevealed = true;

            const neededApps = getAppsForCard(cardText);
            animateReorder(neededApps);
        }

        function animateReorder(newApps) {
            const appGrid = document.getElementById('appGrid');
            const appIcons = Array.from(appGrid.children);

            appIcons.forEach(icon => {
                icon.classList.add('moving');
            });

            setTimeout(() => {
                currentApps = newApps;
                renderApps(newApps);
                console.log(' Toca DOCK');
            }, 600);
        }

        function resetTrick() {
            pulseCount = 0;
            mode = 'value';
            cardValue = null;
            cardSuit = null;
            isRevealed = false;
            
            currentApps = getInitialApps();
            renderApps(currentApps);
            
            console.log(' Reset');
        }

        document.getElementById('dock').addEventListener('click', (e) => {
            e.stopPropagation();
            if (isRevealed) {
                resetTrick();
            }
        });

        document.getElementById('leftBtn').addEventListener('click', () => {
            handlePulse('left');
        });

        document.getElementById('rightBtn').addEventListener('click', () => {
            handlePulse('right');
        });

        document.addEventListener('DOMContentLoaded', () => {
            currentApps = getInitialApps();
            renderApps(currentApps);
            
            console.clear();
            console.log(' APP MGICA COMPLETA!');
            console.log(' 40 apps - 33 con logos (82.5%)');
            console.log('testMagicTrick(12, 1)');
        });

        window.testMagicTrick = function(value, suit) {
            if (isRevealed) {
                console.log(' Toca dock');
                return;
            }
            performMagicReveal(value, suit);
        };

        window.resetTrick = resetTrick;
    </script>
</body>
</html>
